import { Outlet } from "react-router-dom";
import { Fragment } from "react";

function Nav() {
	return (
		<Fragment>
			<div className="nav">
				<div>Logo</div>
			</div>
			<Outlet />
		</Fragment>
	);
}

export default Nav;
